@csrf_exempt
def cropImage(request):
	if request.POST:
		imageData = request.POST['para']
		imgDataObj = JSONObject()
		imgDataObj = JSONValue.parse(imageData)
		#print imgDataObj.get("imageData")
		imgSrc = imgDataObj.get("imageData")
		imageHeight = imgDataObj.get("imageHeight")
		imageWidth = imgDataObj.get("imageWidth")
		imagePosX = imgDataObj.get("imagePosX")
		imagePosY = imgDataObj.get("imagePosY")
		
		resData = JSONObject()
		objImageCropper = ImageCropper()		
		croppedData = objImageCropper.cropToBase64(imgSrc,imageHeight,imageWidth,imagePosX,imagePosY)
		croppedData = "data:image/jpeg;base64,"+croppedData
		resData.put("croppedData",croppedData)		
		return HttpResponse(resData.toJSONString(),content_type ='application/json')
	else:
		message = 'worng url cropImage'
		return HttpResponse(message)

